import VehiclesItem from "./VehiclesItem.js";
export default {
  template: `
    <div class="controls-main__wrapper">
        <div class="controls-main__content">
            <div class="controls-main__content-list square">
                <VehiclesItem 
                    v-for="vehicle in vehicles" 
                    :vehicle="vehicle"
                    :key="getVehicleKey(vehicle)">
                </VehiclesItem>
            </div>
        </div>
    </div>
    `,
  components: {
    VehiclesItem
  },
  props: {
    vehicles: {
      type: Array,
      required: true
    }
  },
  methods: {
    getVehicleKey(vehicle) {
      return vehicle && vehicle.id !== undefined ? vehicle.id : 0;
    }
  }
};
